import React, {Component} from 'react';
import './App.css';
import challenges from './challengesList.js';
import './challenges.css';


class CallChallenges extends Component{

 rChallenge = () => {
     return challenges[Math.floor(Math.random() * challenges.length)];
 };


 render(){
   let chall = this.rChallenge();
   return(
     <div>
     <div class="boxed">
    {chall.Title}
    <button type="button" class="btn btn-primary btn-lg btn-block">Completed</button>
    <button type="button" class="btn btn-secondary btn-lg btn-block">New Task</button>
    </div>
     </div>

   );
 }
}

export default CallChallenges;
